import "./footer.css";
import ColFooter from "./colFooter/colFooter";
import footerArr from "./footer.json";
const Footer = () => {
  console.log(
    footerArr.filter((el) => el.col_number === 1).map((el) => el.col_values)
  );
  return (
    <div className="container mt-5">
      <div className="footer d-flex justify-content-between">
        <ColFooter
          col_number={footerArr
            .filter((el) => el.col_number === 1)
            .map((el) => el.col_values)}
          index={1}
        ></ColFooter>
        <ColFooter
          col_number={footerArr
            .filter((el) => el.col_number === 2)
            .map((el) => el.col_values)}
          index={2}
        ></ColFooter>
        <ColFooter
          col_number={footerArr
            .filter((el) => el.col_number === 3)
            .map((el) => el.col_values)}
          index={3}
        ></ColFooter>
        <ColFooter
          col_number={footerArr
            .filter((el) => el.col_number === 4)
            .map((el) => el.col_values)}
          index={4}
        ></ColFooter>
        <ColFooter
          col_number={footerArr
            .filter((el) => (el.col_number = 5))
            .map((el) => el.col_values)}
          index={5}
        ></ColFooter>
      </div>
    </div>
  );
};

export default Footer;
